import React,{useState} from "react";
import "./App.css";
import StartPage from "./components/StartPage/StartPage";

function App() {
   const [matrix, setMatrix] = useState(null);

   return (
      <div className="App">
         <StartPage createMatrix={setMatrix}/>
      </div>
   );
}

export default App;
